    return (
        <div>
            <div>
                <img src='https://logos-world.net/wp-content/uploads/2022/04/OLX-Symbol.png'
                className="header logo" height={60} width={60} />
            </div>
            <div>
                <p>hello</p>
            </div>
        </div>
    );
};
 
export default Headerbar;
